"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[5705],{2414:e=>{e.exports=JSON.parse('{"label":"Data Visualization","permalink":"/portfolio/docs/tags/data-visualization","allTagsPath":"/portfolio/docs/tags","count":3,"items":[{"id":"data-visualization/pitfalls","title":"Pitfalls in Data Visualization","description":"Hello data enthusiasts!","permalink":"/portfolio/docs/data-visualization/pitfalls"},{"id":"misc/qrcode","title":"QR Code","description":"Welcome to the world of QR code generation! As a data scientist, I understand the importance of effective data representation, and QR codes are a fantastic tool for this purpose. In this tutorial, we\u2019ll embark on a journey to demystify QR code generation using python-qrcode, ensuring that you gain practical skills to implement QR code generation effortlessly. So, grab your coding gear and let\u2019s get started!","permalink":"/portfolio/docs/misc/qrcode"},{"id":"data-visualization/venn","title":"Venn Diagram","description":"In the world of data visualization, few tools have gained as much recognition as Venn diagrams. These overlapping circles have become synonymous with illustrating set relationships, making complex data more accessible at a glance. Yet, while Venn diagrams are undeniably valuable, they also have a propensity to mislead. As a data scientist, I\u2019ve encountered their allure and their limitations. In this article, we\u2019ll delve into why Venn diagrams, despite their apparent simplicity, can be misleading if not used with caution. We\u2019ll explore the intricacies that lie beneath those overlapping circles, shedding light on when and how to employ them effectively, and when to turn to alternative visualization methods for a more accurate representation of data.","permalink":"/portfolio/docs/data-visualization/venn"}]}')}}]);